import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAddressCard, faCircleHalfStroke, faGear } from '@fortawesome/free-solid-svg-icons';

const PrivateNavBar: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className={`fixed top-0 left-0 bg-black w-24 h-24 rounded-br-full transition-all duration-1000 ease-in-out z-10 ${isOpen ? 'w-72 h-72' : ''}`}>
      <div className="absolute top-0 left-0 w-12 h-12 rounded-full cursor-pointer bg-white z-20 transition-all duration-1000 ease-in-out"
           onClick={() => setIsOpen(!isOpen)}>
        <div className={`absolute w-6 h-1 bg-gray-800 rounded-full top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 ${isOpen ? 'opacity-0' : ''}`}><FontAwesomeIcon icon={faAddressCard} /></div>
        <div className={`absolute w-6 h-1 bg-gray-800 rounded-full top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 ${isOpen ? 'rotate-45' : 'translate-y-[-10px]'}`}><FontAwesomeIcon icon={faAddressCard} /></div>
        <div className={`absolute w-6 h-1 bg-gray-800 rounded-full top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 ${isOpen ? 'rotate-[-45deg]' : 'translate-y-[10px]'}`}><FontAwesomeIcon icon={faAddressCard} /></div>
      </div>
      <div className="absolute top-0 left-0 z-10 flex flex-col space-y-4 p-4">
      <i className="fa  text-gray-800"><FontAwesomeIcon icon={faAddressCard} /></i>
        <i className="fa  text-gray-800"><FontAwesomeIcon icon={faCircleHalfStroke} rotation={270} /></i>
        <i className="fa  text-gray-800"><FontAwesomeIcon icon={faGear} /></i>
      </div>
    </div>
  );
};

export default PrivateNavBar;
